import { useState } from "react"
import CustomButton from "../CustomButton"
import Input from "../CustomInput"

const AddPhoneNumber = () => {
    const [newNumber, setNewNumber] = useState([{ country: '', no: '' }])
    const handleClick = () => {
        setNewNumber([
            { ...newNumber, country: '', no: '' }
        ])
    }
    return (
        <div>
            <div className="flex mb-2 justify-between">
                <p className="text-[#0E253C] flex text-[12px] font-medium">
                    Phone Number
                </p>
                <img src={`images/add-btn.svg`} className="cursor-pointer" alt='add' onClick={() => handleClick()} />
            </div>

            <div className="flex items-center">
                {
                    newNumber.map((_item, index) => {
                        return (<div key={index}>
                            <select>
                                <option><img src={`images/us-flag.svg`} alt='disk' /> US</option>
                                <option> <img src={`images/us-flag.svg`} alt='disk' />IN</option>
                            </select>
                            <Input className={''} />
                            <CustomButton className="text-[12px] font-medium bg-transparent text-[#DC3545] border-[#DC3545]">Remove</CustomButton>
                        </div>)
                    })
                }

            </div>
        </div>
    )
}

export default AddPhoneNumber
